export default function profitabilitySimulator () {
  let date = new Date("2015-01-01");
let endDate = new Date("2021-12-31");
let profitability = 0;

let data = [];

while (date <= endDate) {
  profitability += Math.random() * (0.1) - 0.05;
  // profitability = Math.max(-0.05, Math.min(0.1, profitability));

  data.push({
    dateObject: date,
    date: date.toLocaleDateString("pt-BR", {
      day: "2-digit",
      month: "2-digit",
      year: "numeric"
    }),
    profitability
  });

  date.setDate(date.getDate() + 1);
}

const chartData = data.map((info) => [info.date, Number(info.profitability), info.dateObject])
chartData.unshift(["Data", 'Rentabilidade'])
return chartData

}
